import React, { useState, useEffect } from 'react'
import Table from '../Table'
import { Users } from '../users'
import { AllSymptoms } from '../symptoms'
import search from './images/search.png'

function Search({ query, setQuery, search }) {

  return (
    <div className='searchContainer'>
        <input type="text" placeholder='ძებნა...' className="search" onChange={e => setQuery(e.target.value)}/><img src={search} />

        {AllSymptoms.map((symptom) => (
          <div className='symtomCheckbox'>
            <input name="symptom" type="checkbox" />
            <label>{ symptom.symptom }</label>
          </div>
        ))}

        <Table data={search(Users)} />
    </div>
  )
}

export default Search
